import aboutPhoto from "../../assets/profile.jpg";

const AboutMe = () => {
  return (
    <div className="container flex flex-row justify-between mx-auto">
      <div className="flex flex-col justify-start">
        <div className="font-bold text-orange-600">About Me</div>
      </div>
      <div className="flex justify-center">
        <img src={aboutPhoto} className="w-[200px] h-40" alt="about-photo" />
      </div>
    </div>
  );
};

export default AboutMe;
